import { IJourney } from "../interfaces/Journey";
import { Flight } from "./Flight";

export class Journey implements IJourney{
    origin: string;
    destination: string;
    price: number;
    flights: Flight[];

    constructor(flights: Flight[], origin: string, destination: string, price: number) {
        this.flights = flights;
        this.origin = origin;
        this.destination = destination;
        this.price = price;
    }
}
